import React from 'react';
import '../App.css';
import './Dashboard.css';
import FileUpload from '../components/FileUpload';


function Dashboard() {
  return (
    <div>
        <h1 className='center'>Dashboard</h1>
        <FileUpload className="center"/>
    </div>
  )
}

export default Dashboard
